class Player {
    constructor(firstName, lastName, personId, teamId, jersey, pos, isDT, height, weight) {
        this.firstName = firstName
        this.lastName = lastName
        this.personId = personId
        this.teamId = teamId
        this.jersey = jersey
        this.pos = pos
        this.isDT = isDT
        this.height = height
        this.weight = weight
    }
}
